import { generateUtilityClass, generateUtilityClasses } from '@mui/base';
export function getButtonUtilityClass(slot) {
  return generateUtilityClass('MuiButton', slot);
}
const buttonClasses = generateUtilityClasses('MuiButton', ['root', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantText', 'variantOutlined', 'variantLight', 'variantContained', 'focusVisible', 'disabled', 'sizeSm', 'sizeMd', 'sizeLg', 'fullWidth', 'startIcon', 'endIcon']);
export default buttonClasses;
